    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Cross Creeks NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Cross Creeks NWR will
    contribute to the overall mission of the Refuge System. The plan provides an introduction
    to the Refuge, an overview of the CCP process, and information about the management
    direction and plan implementation. Key planning issues include: fish and wildlife
    population management, habitat management, resource protection, visitor services,
    refuge administration, and wilderness review.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
